import './account_template.css'

export const AccountTemplate = (props) => {
    return ( <div className= 'row'>
        <div className="backg col-md-3 col-lg-12"></div>
        <div className='auth col-md-5 col-lg-12'>{props.children}</div>
        <div className='brand col-md-4 col-lg-12'></div>
        </div>
        )
}
